import React from "react";
import styled from "styled-components";

const Wrapper = styled.div`
  width: 100%;
  height: 100%;
  background-color: green;
  margin-bottom: 3px;
`;

const CoinHandler = ({ coin }) => {
  console.log(coin);
  return (
    <Wrapper>
      <NameP></NameP>
      <SymbolP></SymbolP>
      <Img></Img>
      
    </Wrapper>
  );
};

export default CoinHandler;
